import './App.css';

import React, { Component } from 'react'
import Navbar from './components/Navbar';
import News from './components/News';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from "react-router-dom";
import LoadingBar from 'react-top-loading-bar'


export default class App extends Component {

  state ={
    progress:0,
  }

  setProgress = (progress) =>{
      this.setState({progress:progress})
  }

  render() {
    return (
      <div>
      <Router>
    <Navbar/>
     <LoadingBar
        color='#f11946'
        progress={this.state.progress}

      />
    <Routes>
     <Route exact path="/" element={<News setProgress={this.setProgress} key="generals" pageSize={6} newsKey='6ebc2a61e4214ddebacf3db11107688e' category="general" setCountry="in"/>} >
      </Route>

          <Route exact path="/business" element={<News setProgress={this.setProgress} key="business" pageSize={6} newsKey='6ebc2a61e4214ddebacf3db11107688e' category="business" setCountry="in"/>}>

          </Route>
          <Route exact path="/entertainment" element={<News setProgress={this.setProgress} key="entertainment" pageSize={6} newsKey='6ebc2a61e4214ddebacf3db11107688e' category="entertainment" setCountry="in"/>}>

          </Route>
          <Route  exact path="/health" element={<News setProgress={this.setProgress} key="health" pageSize={6} newsKey='6ebc2a61e4214ddebacf3db11107688e' category="health" setCountry="in"/>}>

          </Route>
          <Route exact path="/science" element={ <News setProgress={this.setProgress} key="science" pageSize={6} newsKey='6ebc2a61e4214ddebacf3db11107688e' category="science" setCountry="in"/>}>

          </Route>
          <Route exact path="/sports" element={<News setProgress={this.setProgress} key="sports" pageSize={6} newsKey='6ebc2a61e4214ddebacf3db11107688e' category="sports" setCountry="in"/>}>

          </Route>
          <Route exact path="/technology" element={<News setProgress={this.setProgress} key="technology" pageSize={6} newsKey='6ebc2a61e4214ddebacf3db11107688e' category="technology" setCountry="in"/>}>

          </Route>

        </Routes>
    </Router>
      </div>
    )
  }
}
